import React, { Component } from "react";
import "../App.css";
import Main from './main'

class testcomp extends Component {
  render() {
    let people = [
      { name: "Adil", firstName: "Imashev" },
      { name: "Danil", firstName: "Dastanov" },
    ];

    let orimer = 
      people.map((peson) => 
      <Main 
      name={peson.name}
      firstName={peson.firstName}>
      </Main>);
    
    return <div>
    {orimer}  
    </div>;
  }
}

export default testcomp;
